import { Button } from '@mui/material';

export default function InputButton() {
  return (
    <Button
      variant="contained"
      sx={{
        m: 1,
        width: '552px',
        bgcolor: 'gray',
        marginTop: '20px',
        fontFamily: 'Montserrat',
      }}
    >
      Create An Account
    </Button>
  );
}
